import React, { useState, useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { getAllFood } from '../../actions/foodActions.js'
import pizzas from "../../pizzasdata.js"
import Pizza from '../Pizza'

const Homescreen = () => {
    const dispatch = useDispatch()
    const foodstate = useSelector(state => state.getAllFoodReduer)
    console.log(foodstate, "foodstate")
    // const { food, error, loading } = foodstate;
    let food, error, loading;
    console.log(food, "food reducer")
    useEffect(() => {
        dispatch(getAllFood())
    }, [])
    return (
        <div>
            <div className="row">
                {loading ?
                    (
                        <h1>Loading</h1>
                    ) : error ? (
                        <h1>Something Went Wrong</h1>
                    ) : (
                        pizzas.map(pizzas => {
                            return <div className="col-md-4 p-3">
                                <div>
                                    <Pizza pizza={pizzas} />
                                </div>
                            </div>
                        })
                    )
                }
            </div>
        </div>
    )
}

export default Homescreen
